import React from 'react';

function Card({country}) {
    return (
        <div>
            <ul className="card">
                {country.map(pays=>(
                    <li key={pays.name.capital}>
                        {pays.name.common}
                        {pays.name.flags.svg}
                        {pays.name.capital}
                        {pays.name.population}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Card;
